import React from 'react'
import SocialLogin from 'react-social-login';

let SocialLoginHoc = (WrappedComponent: any) => {

    let loginProps = ({ ...props }) => {
        const { children, triggerLogin, ...otherProps } = props;
        return (
            <WrappedComponent onClick={triggerLogin} {...otherProps} >
                {children}
            </WrappedComponent>
        )
    }
    return SocialLogin(loginProps);
}

export default SocialLoginHoc;
